import React, { useState } from "react";
import { useAuth } from "../../context/AuthContext";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const CreateEmployee = () => {
  const [adminName, setName] = useState("");
  const [adminEmail, setEmail] = useState("");
  const [charges, setCharges] = useState("");
  const [description, setDescription] = useState("");
  const [adminPhone, setPhone] = useState("");
  const [education, setEducation] = useState("");
  const [photo, setPhoto] = useState(null);
  const [experience, setExperience] = useState("");
  const navigate = useNavigate();
  const [auth] = useAuth();

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const formData = new FormData();
      formData.append("adminName", adminName);
      formData.append("adminEmail", adminEmail);
      formData.append("description", description);
      formData.append("charges", charges);
      formData.append("adminPhone", adminPhone);
      formData.append("education", education);
      formData.append("experience", experience);
      formData.append("photo", photo);

      const res = await axios.post("/v1/admin/employee-data", formData);
      if (res.data.success) {
        navigate("/dashboard");
      }
    } catch (error) {
      console.error("Error submitting form", error);
    }
  };

  return (
    <div style={{
      display: "flex", flexDirection: "column", alignItems: "center", minHeight: "100vh", padding: "20px", backgroundColor: "#f8f9fa"
    }}>
      <h2 style={{ color: "#333", textAlign: "center", marginBottom: "20px" }}>
        Hey {auth?.user?.name?.toUpperCase()}, Please fill out the Employee Data carefully
      </h2>
      <form onSubmit={handleSubmit} style={{ width: "50%", background: "#ffffff", padding: "20px", borderRadius: "8px", boxShadow: "0px 0px 10px rgba(0, 0, 0, 0.1)" }}>
        <div className="mb-3">
          <label>Name</label>
          <input type="text" value={adminName} onChange={(e) => setName(e.target.value)} className="form-control" placeholder="Enter Name" />
        </div>
        <div className="mb-3">
          <label>Email</label>
          <input type="email" value={adminEmail} onChange={(e) => setEmail(e.target.value)} className="form-control" placeholder="Enter Email" />
        </div>
        <div className="mb-3">
          <label>Base Charge ($)</label>
          <input type="number" value={charges} onChange={(e) => setCharges(e.target.value)} className="form-control" placeholder="Enter Charge" />
        </div>
        <div className="mb-3">
          <label>Phone No.</label>
          <input type="tel" value={adminPhone} onChange={(e) => setPhone(e.target.value)} className="form-control" placeholder="Enter Phone Number" />
        </div>
        <div className="mb-3">
          <label>Education</label>
          <input type="text" value={education} onChange={(e) => setEducation(e.target.value)} className="form-control" placeholder="Enter Education" />
        </div>
        <div className="mb-3">
          <label>LinkedIn URL</label>
          <input type="text" value={experience} onChange={(e) => setExperience(e.target.value)} className="form-control" placeholder="Enter LinkedIn URL" />
        </div>
        <div className="mb-3">
          <label>Description</label>
          <textarea value={description} onChange={(e) => setDescription(e.target.value)} className="form-control" placeholder="Enter Description"></textarea>
        </div>
        <div className="mb-3">
          <label>Photo</label>
          <input type="file" onChange={(e) => setPhoto(e.target.files[0])} className="form-control" />
        </div>
        <button type="submit" className="btn btn-primary w-100">Add Employee</button>
      </form>
    </div>
  );
};

export default CreateEmployee;
